        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](168, "5.7. \u0414\u043B\u044F \u0446\u0435\u043B\u0435\u0439 \u0434\u043E\u0441\u0442\u0443\u043F\u0430 \u043A \u043E\u0442\u0434\u0435\u043B\u044C\u043D\u044B\u043C \u0421\u0435\u0440\u0432\u0438\u0441\u0430\u043C \u043D\u0430 Altair \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u0435\u043C \u043C\u043E\u0433\u0443\u0442 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C\u0441\u044F \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0438\u043C \u0443\u043D\u0438\u043A\u0430\u043B\u044C\u043D\u044B\u0435 \u0438\u0434\u0435\u043D\u0442\u0438\u0444\u0438\u043A\u0430\u0442\u043E\u0440\u044B (\u043D\u0430\u0431\u043E\u0440 \u0441\u0438\u043C\u0432\u043E\u043B\u043E\u0432) \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F, \u0443\u0447\u0435\u0442\u043D\u043E\u0439 \u0437\u0430\u043F\u0438\u0441\u0438 \u043D\u0430 \u0421\u0430\u0439\u0442\u0435, \u041E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u044F, \u0422\u043E\u0432\u0430\u0440\u0430 \u0438 \u043F\u0440.");
