        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](176, "5.10. \u0415\u0441\u043B\u0438 \u0443 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F \u0432\u043E\u0437\u043D\u0438\u043A\u0430\u044E\u0442 \u043F\u0440\u0435\u0442\u0435\u043D\u0437\u0438\u0438 \u043A \u0434\u0440\u0443\u0433\u043E\u043C\u0443 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044E \u0432 \u0441\u0432\u044F\u0437\u0438 \u0441 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u0435\u043C \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u043C \u0421\u0435\u0440\u0432\u0438\u0441\u043E\u0432 \u0438/\u0438\u043B\u0438 \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u043D\u044B\u043C\u0438 \u0438\u043C \u041E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u044F\u043C\u0438, \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u043E\u0431\u044F\u0437\u0430\u043D \u043F\u0440\u0435\u0434\u044A\u044F\u0432\u043B\u044F\u0442\u044C \u044D\u0442\u0438 \u0442\u0440\u0435\u0431\u043E\u0432\u0430\u043D\u0438\u044F \u043D\u0430\u0434\u043B\u0435\u0436\u0430\u0449\u0435\u043C\u0443 \u043B\u0438\u0446\u0443 (\u041F\u0440\u043E\u0434\u0430\u0432\u0446\u0443) \u0438 \u0440\u0430\u0437\u0440\u0435\u0448\u0430\u0442\u044C \u043F\u0440\u0435\u0442\u0435\u043D\u0437\u0438\u0438 \u0441\u0430\u043C\u043E\u0441\u0442\u043E\u044F\u0442\u0435\u043B\u044C\u043D\u043E \u0438 \u0431\u0435\u0437 \u0443\u0447\u0430\u0441\u0442\u0438\u044F \u0410\u043B\u044C\u0442\u0430\u0438\u0440.");
