        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](200, "7.3. Altair \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u043E\u043C, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F\u043C \u0440\u0430\u0437\u043C\u0435\u0449\u0430\u0442\u044C \u041E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u044F \u0432 \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u0438 \u0422\u043E\u0432\u0430\u0440\u043E\u0432, \u0440\u0435\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u044F \u0438/\u0438\u043B\u0438 \u043F\u0440\u0438\u043E\u0431\u0440\u0435\u0442\u0435\u043D\u0438\u0435 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043D\u044B \u0437\u0430\u043A\u043E\u043D\u043E\u043C \u0438 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u043A\u0438\u043C \u0441\u043E\u0433\u043B\u0430\u0448\u0435\u043D\u0438\u0435\u043C. \u041F\u0440\u0438 \u044D\u0442\u043E\u043C \u0410\u043B\u044C\u0442\u0430\u0438\u0440 \u043D\u0435 \u0432\u0441\u0435\u0433\u0434\u0430 \u043F\u0440\u043E\u0432\u0435\u0440\u044F\u0435\u0442 \u041E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u044F, \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u043D\u044B\u0435 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F\u043C\u0438. \u0422\u0430\u043A\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C, \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u043E, \u0431\u0435\u0437\u043E\u043F\u0430\u0441\u043D\u043E\u0441\u0442\u044C, \u0437\u0430\u043A\u043E\u043D\u043D\u043E\u0441\u0442\u044C \u0438 \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0435 \u0422\u043E\u0432\u0430\u0440\u0430 \u0435\u0433\u043E \u043E\u043F\u0438\u0441\u0430\u043D\u0438\u044E, \u0430 \u0442\u0430\u043A\u0436\u0435 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u041F\u0440\u043E\u0434\u0430\u0432\u0446\u0430 \u043F\u0440\u043E\u0434\u0430\u0442\u044C \u0438/\u0438\u043B\u0438 \u041F\u043E\u043A\u0443\u043F\u0430\u0442\u0435\u043B\u044F \u043F\u0440\u0438\u043E\u0431\u0440\u0435\u0441\u0442\u0438 \u0422\u043E\u0432\u0430\u0440 \u043D\u0430\u0445\u043E\u0434\u044F\u0442\u0441\u044F \u0432\u043D\u0435 \u043A\u043E\u043D\u0442\u0440\u043E\u043B\u044F \u0410\u043B\u044C\u0442\u0430\u0438\u0440. \u0412 \u0441\u0432\u044F\u0437\u0438 \u0441 \u0447\u0435\u043C, \u0410\u043B\u044C\u0442\u0430\u0438\u0440 \u043D\u0435 \u043D\u0435\u0441\u0435\u0442 \u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0441\u0442\u044C \u0437\u0430 \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u043D\u0438\u0435 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u043E\u0439 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F\u043C\u0438, \u0432\u043A\u043B\u044E\u0447\u0430\u044F \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u043D\u0438\u0435 \u041E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u0439, \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u0435 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F\u043C\u0438 \u0442\u043E\u0432\u0430\u0440\u043D\u044B\u0445 \u0437\u043D\u0430\u043A\u043E\u0432, \u043B\u043E\u0433\u043E\u0442\u0438\u043F\u043E\u0432 \u0442\u0440\u0435\u0442\u044C\u0438\u0445 \u043B\u0438\u0446 \u0438 \u0443\u0441\u043B\u043E\u0432\u0438\u0439 \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0435\u043D\u0438\u044F \u041F\u0440\u043E\u0434\u0430\u0432\u0446\u0430.");
